import './dialog.css'

export default function Dialog(props) {
  const {id,  title, yesCallback, noCallback } = props;

  return (
    <div class="backdrop">
      <div class="square"></div>

      <div class="dialog">
        <div class="close-container">
          <span class="close-icon">x</span>
        </div>
        <h1>{title}</h1>

        <p id='p-btn'>
          <button className='btn' onClick={yesCallback}>Yes</button>
          <button className='btn' onClick={noCallback}>No</button>
        </p>
      </div>
    </div>
  );
}
